import { useState } from "react";
import { forgotPassword } from "../../services/guestsService";
import Swal from "sweetalert2/dist/sweetalert2.js";
import "sweetalert2/src/sweetalert2.scss";
function ModalForgotPassword() {
  const [data, setData] = useState([]);

  const handleChange = (e) => {
    const name = e.target.name;
    const value = e.target.value;
    setData({
      ...data,
      [name]: value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const result = await forgotPassword("password/email", data);
    if (
      result?.status === 200 &&
      result?.data?.message?.includes("We have emailed")
    ) {
      Swal.fire({
        position: "center",
        icon: "success",
        title: "Tạo tài khoản thành công!",
        showConfirmButton: false,
        timer: 1500,
      }).then(() => {
        window.location.reload();
      });
    } else if (result?.status === 422 && result?.data?.errors?.email_address) {
      // ❌ Email không hợp lệ hoặc không tồn tại
      console.error("Lỗi:", result.data.errors.email_address[0]);
    } else {
      // ❓ Các lỗi khác
      console.error("Đã xảy ra lỗi không xác định:", result);
    }
  };
  return (
    <>
      {/* <!-- FORGOT SECTION --> */}
      <div id="modal3" className="modal fade" role="dialog">
        <div className="log-in-pop">
          <div className="log-in-pop-left">
            <h1>Hello... </h1>
            <p>
              Don't have an account? Create your account. It's take less then a
              minutes
            </p>
            <h4>Login with social media</h4>
            <ul>
              <li>
                <a href="#">
                  <i className="fa fa-facebook"></i> Facebook
                </a>
              </li>
              <li>
                <a href="#">
                  <i className="fa fa-google"></i> Google+
                </a>
              </li>
              <li>
                <a href="#">
                  <i className="fa fa-twitter"></i> Twitter
                </a>
              </li>
            </ul>
          </div>
          <div className="log-in-pop-right">
            <a href="#" className="pop-close" data-dismiss="modal">
              <img src="images/cancel.png" alt="" />
            </a>
            <h4>Forgot password</h4>
            <p>
              Don't have an account? Create your account. It's take less then a
              minutes
            </p>
            <form className="s12" onSubmit={handleSubmit}>
              <div>
                <div className="input-field s12">
                  <input
                    type="text"
                    data-ng-model="name3"
                    className="validate"
                    name="email_address"
                    onChange={handleChange}
                  />
                  <label>Email</label>
                </div>
              </div>
              <div>
                <div className="input-field s4">
                  <input
                    type="submit"
                    value="Submit"
                    className="waves-effect waves-light log-in-btn"
                  />
                </div>
              </div>
              <div>
                <div className="input-field s12">
                  <a
                    href="#"
                    data-dismiss="modal"
                    data-toggle="modal"
                    data-target="#modal1"
                  >
                    Are you a already member ? Login
                  </a>
                  |
                  <a
                    href="#"
                    data-dismiss="modal"
                    data-toggle="modal"
                    data-target="#modal2"
                  >
                    Create a new account
                  </a>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </>
  );
}

export default ModalForgotPassword;
